import{_ as e,o as i,c as a,O as r}from"./chunks/framework.9482e208.js";const m=JSON.parse('{"title":"§ 13.1-1005 Fees.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/13.1-1005.md","filePath":"vacode/13.1-1005.md"}'),t={name:"vacode/13.1-1005.md"},o=r('<h1 id="§-13-1-1005-fees" tabindex="-1">§ 13.1-1005 Fees. <a class="header-anchor" href="#§-13-1-1005-fees" aria-label="Permalink to &quot;§ 13.1-1005 Fees.&quot;">​</a></h1><p>The Commission shall charge and collect the following fees:</p><ol><li>For filing any one of the following, the fee shall be $100:</li></ol><p>a. Articles of organization.</p><p>b. An application for registration as a foreign limited liability company.</p><p>c. Articles of entity conversion to convert a limited liability company to a domestic business trust or to convert a domestic partnership or limited partnership to a limited liability company.</p><p>d. Articles of domestication.</p><p>e. A statement of protected series designation.</p><p>f. An application for registration as a foreign protected series.</p><ol start="2"><li>For filing any one of the following, the fee shall be $25:</li></ol><p>a. Articles of amendment.</p><p>b. Articles of cancellation.</p><p>c. Articles of correction referred to in § <a href="/vacode/13.1-1011.1/">13.1-1011.1</a>, a copy of an amendment or correction referred to in § <a href="/vacode/13.1-1055/">13.1-1055</a>, or an amended application for registration referred to in § <a href="/vacode/13.1-1055/">13.1-1055</a>, provided that an amended application shall not require a separate fee when it is filed with a copy of an amendment or a correction referred to in § <a href="/vacode/13.1-1055/">13.1-1055</a>.</p><p>d. A copy of an instrument of merger of a foreign limited liability company referred to in § <a href="/vacode/13.1-1060/">13.1-1060</a>.</p><p>e. Articles of merger.</p><p>f. Articles of entity conversion to convert a limited liability company to a domestic corporation, in addition to a charter fee ascertained in accordance with § <a href="/vacode/13.1-615.1/">13.1-615.1</a>.</p><p>g. A copy of an instrument of entity conversion of a foreign limited liability company holding a certificate of registration to transact business in the Commonwealth.</p><p>h. Articles of restatement.</p><p>i. Articles of organization surrender.</p><p>j. An application for a certificate of cancellation to cancel a certificate of registration as a foreign limited liability company.</p><p>k. A statement of designation change pursuant to § <a href="/vacode/13.1-1095/">13.1-1095</a> or <a href="/vacode/13.1-1096/">13.1-1096</a>.</p><p>l. A statement of designation cancellation.</p><p>m. An application for a certificate of cancellation to cancel a certificate of registration as a foreign protected series.</p><ol start="3"><li>For filing any one of the following, the fee shall be $10:</li></ol><p>a. An application to reserve or to renew the reservation of a name for use by a domestic or foreign limited liability company.</p><p>b. A notice of the transfer of a name reserved for use by a domestic or a foreign limited liability company.</p><ol start="4"><li>For issuing a certificate pursuant to § <a href="/vacode/13.1-1067/">13.1-1067</a> or <a href="/vacode/13.1-1099/">13.1-1099</a>, $6 for each certificate.</li></ol><p>1991, c. 168; 1992, cc. 574, 575; 1993, c. 113; 1995, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?951+ful+CHAP0368" target="_blank" rel="noreferrer">368</a>; 1998, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?981+ful+CHAP0432" target="_blank" rel="noreferrer">432</a>; 2001, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?011+ful+CHAP0545" target="_blank" rel="noreferrer">545</a>; 2002, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?021+ful+CHAP0001" target="_blank" rel="noreferrer">1</a>; 2003, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?031+ful+CHAP0379" target="_blank" rel="noreferrer">379</a>; 2004, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?041+ful+CHAP0274" target="_blank" rel="noreferrer">274</a>; 2005, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?051+ful+CHAP0255" target="_blank" rel="noreferrer">255</a>; 2006, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?061+ful+CHAP0748" target="_blank" rel="noreferrer">748</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?061+ful+CHAP0912" target="_blank" rel="noreferrer">912</a>; 2007, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?071+ful+CHAP0810" target="_blank" rel="noreferrer">810</a>; 2008, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?081+ful+CHAP0108" target="_blank" rel="noreferrer">108</a>; 2012, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?121+ful+CHAP0130" target="_blank" rel="noreferrer">130</a>; 2019, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?191+ful+CHAP0636" target="_blank" rel="noreferrer">636</a>; 2021, Sp. Sess. I, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?212+ful+CHAP0487" target="_blank" rel="noreferrer">487</a>.</p>',28),n=[o];function l(c,f,p,s,g,h){return i(),a("div",null,n)}const v=e(t,[["render",l]]);export{m as __pageData,v as default};
